import React from "react";

function Header() {

    function Football() {
        const shoot = () => {
          alert("Great Shot!");
        }
      
        return (
          <button onClick={shoot}>Take the shot!</button>
        );
      }
      
      const root = ReactDOM.createRoot(document.getElementById('root'));
      root.render(<Football />);
}
 
export default Header;
